import React from 'react';
import { View, Text, StyleSheet } from 'react-native';
import { PackageIcons } from './';

const Packages = () => {
    return (
        <View>
            <PackageIcons />
        </View>
    );
}

const styles = StyleSheet.create({})

export default Packages;
